import logo from './hiish.svg';
import plus from './plus.svg';
import search from './search.svg';

function Navbar() {
  return (
    <div>
      <div className="navbar">
          <div className="navbar-top">
              <img src={logo}/>
          </div>
          <div className="navbar-mid">
              <img src={logo}/>
          </div>
          <div className="navbar-btm">
              <div>
                  <img src={plus}/>
                  <img src={search}/>
              </div>
          </div>
      </div>
    </div>
  );
}

export default Navbar;
